import './LoginLink.css';
import axios from "axios";

const LoginLink = () => {
	const authenticate = () => {
		axios.post('http://192.168.100.8:8080/api/v1/drf-auth/login/', {
			'username': 'adm1',
			'password': 'adm1',
		})
	}
	return (
		<div className="login_link" onClick={ authenticate }>
			Login
		</div>
	)
}

export default LoginLink;
